"27963" : {
"id":27963,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP080: Aan het tijdstip waarop en de volgorde waarin berichten worden ontvangen en verwerkt kunnen ketenpartijen geen betekenis hechten.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Hoewel ongewenst kan het noodzakelijk zijn een bericht met terugwerkende kracht te moeten versturen, bijvoorbeeld als gevolg van een bezwaarprocedure. Dit kan aanleiding zijn voor een serie berichten die vervolgens met terugwerkende kracht moeten worden verstuurd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Daarnaast kan ook het afkeuren en corrigeren van berichten er toe leiden dat berichten in een andere volgorde worden verwerkt dan bedoeld. In deze situatie is het te adviseren om de ontvangst van retourberichten af te wachten om afkeur op een vervolgbericht te voorkomen.&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\">Voor de berichten die het zorgkantoor naar het CAK stuurt is het van belang om&nbsp;<p style=\"margin-top: 3pt;\">- voor een client eerst de MAZ (melding aanvang zorg, CA317) te sturen en pas na ontvangst van het retourbericht op de MAZ een eventuele MUT (melding einde zorg, CA319) te sturen;&nbsp;<p style=\"margin-top: 3pt;\">- een nieuwe MAZ (in het geval van een MAZ op MAZ-situatie) pas te versturen na ontvangst van het retourbericht op de eerst verstuurde MAZ;&nbsp;<p style=\"margin-top: 3pt;\">- een correctie (wijziging of verwijdering) op een eerder bij het CAK aangeleverde MAZ of MUT pas te versturen na ontvangst van het retourbericht op de oorspronkelijke aanlevering.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"CA319","id":29113,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP080","geen technische regels":false}}}]
}
]
}
