"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien Mutatiecode de waarde 12 (Cli</span><span style=\" font-size: 10pt; font-family: Arial;\">e</span><span style=\" font-size: 10pt;\">nt wil nu de zorg (nog) niet), '18' (Aanbieder kan nu de zorg nog niet leveren) of '21' (Overdracht (er is geen MAZ)) bevat, mag er voor de betreffende zorgtoewijzing niet reeds een melding aanvang zorg zijn met een Begindatum die voor de Mutatiedatum ligt, tenzij voor deze zorgtoewijzing een mutatie met Mutatiecode '20' (Levering zorg is be</span><span style=\" font-size: 10pt; font-family: Arial;\">e</span><span style=\" font-size: 10pt;\">indigd - zorgtoewijzing aanhouden) is verstuurd.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR078","niveau":"berichtoverstijgend"}}}]
