"lang":"nl",
"name":"CS089: Als LandCode de waarde NL (Nederland) heeft, dan moet het formaat overeenkomen met dat van een Nederlandse postcode.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Concreet betekent dit dat de waarde moet voldoen aan de reguliere expressie: [1-9][0-9]{3}[a-zA-Z]{2}. &nbsp;<p style=\"margin-top: 3pt;\">Zie ook <A TARGET=blank HREF=\"https://www.postcode.nl/\">https://www.postcode.nl/</A>.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Constraint":{"code":"CS089"}}}]
