"lang":"nl",
"name":"TR070: Ingangsdatum en Einddatum van de aangevraagde zorgtoewijzing moeten vallen binnen de geldigheidsduur van de toewijzing waarop het MutatieZorgzwaartepakket van toepassing is.",
"type":"Beperking",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Alleen van toepassing indien voor de client voor wie een aanvraag wordt ingediend ook een MutatieZorgzwaartepakket aanwezig is.&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">Geldigheidsduur is de periode van Ingangsdatum toegewezen zorgeenheid (functie of zorgzwaartepakket) tot en met Einddatum toegewezen zorgeenheid (functie of zorgzwaartepakket) (dat is inclusief de ingangs- en einddatum van de geldigheidsduur).&nbsp;<p style=\"margin-top: 3pt;\"></span><span style=\" font-size: 10pt; font-family: Arial;\"></span><span style=\" font-size: 10pt; font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"LDT_RetourCode-Wlz","id":30317,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Technische regel":{"code":"TR070","niveau":"berichtoverstijgend"}}}]
