"lang":"nl",
"name":"OP066: Indien er wijzigingen in de zorglevering plaatsvinden moet de zorgaanbieder dit melden met een bericht.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Wijzigingen in de zorglevering zijn bijvoorbeeld:&nbsp;<p style=\"margin-top: 3pt;\">* begin zorglevering;&nbsp;<p style=\"margin-top: 3pt;\">* andere geleverde klasse;&nbsp;<p style=\"margin-top: 3pt;\">* andere leveringsstatus;&nbsp;<p style=\"margin-top: 3pt;\">* andere leveringsvorm;&nbsp;<p style=\"margin-top: 3pt;\">* einde zorglevering.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Een nieuwe of gewijzigde zorgtoewijzing kan een aanleiding zijn voor een wijziging van de zorglevering; in de berichten moet gerefereerd worden aan de betreffende zorgtoewijzing.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Fluctuaties in de hoeveelheid geleverde zorg worden niet gemeld; alleen wijzigingen die leiden tot een andere klasse of leveringsstatus en/of classificatie worden gemeld.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP066","geen technische regels":false}}}]
