"28559" : {
"id":28559,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP309: Het zorgkantoor draagt bij verhuizing van de client naar een andere zorgkantoorregio het dossier van de client over aan het desbetreffende zorgkantoor.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Met ingang van de overdrachtdatum, die altijd na de verhuisdatum ligt, is het nieuwe zorgkantoor verantwoordelijk voor de client. Overdracht vindt niet met terugwerkende kracht plaats.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Het zorgkantoor ontvangt vanuit de Basisregistratie Personen (BRP) melding van de verhuizing van de cli&#235;nt. Het zorgkantoor draagt de cli&#235;nt op basis van dit signaal over aan het nieuwe zorgkantoor.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien de client in het kalenderjaar waarin de verhuizing plaatsvindt geen of uitsluitend zorg in natura heeft ontvangen, vindt dossieroverdracht zo spoedig mogelijk plaats, maar uiterlijk 30 kalenderdagen na de dag waarop het zorgkantoor het bericht van verhuizing vanuit de BRP heeft ontvangen. Het bijbehorende iWlz-bericht (ZK31) wordt op de dag voorafgaand aan de overdrachtdatum verstuurd.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien de client in het kalenderjaar waarin de verhuizing plaatsvindt een pgb-toewijzing van minimaal 2 aaneengesloten dagen heeft (gehad) en/of er is aan de client een pgb-budget &nbsp;toegekend, vindt dossieroverdracht plaats per 1 januari van het kalenderjaar volgend op het bericht vanuit de BRP over de verhuizing van de cli&#235;nt. Het bijbehorende iWlz-bericht (ZK31) mag uitsluitend in de aan de dossieroverdracht voorafgaande maand november of december verstuurd worden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP309"}}}]
}
]
}
