"28568" : {
"id":28568,
"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP055: Indien de voorkeuraanbieder de toegewezen zorg (nu) nog niet kan leveren of de client de toegewezen zorg (nu) nog niet kan of wil ontvangen, vraagt deze aanbieder (in overleg met de betrokken zorgaanbieder(s)) een aangepaste zorgtoewijzing aan.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Indien de voorkeuraanbieder een zorgtoewijzing voor verblijf, deeltijdverblijf (DTV) of een volledig pakket thuis (VPT) heeft ontvangen, is hij dossierhouder. Indien de voorkeuraanbieder een zorgtoewijzing voor een modulair pakket thuis (MPT) heeft ontvangen, is hij coordinator zorg thuis.&nbsp;<p style=\"margin-top: 3pt;\">De aanvraag kan zowel aangevraagde zorgeenheden voor de voorkeuraanbieder zelf als voor een andere zorgaanbieder bevatten. Als de voorkeuraanbieder geen aanbieder kan vinden die de zorg aan de client kan leveren, mag hij de bemiddelingsrol terugleggen bij het zorgkantoor.&nbsp;<p style=\"margin-top: 3pt;\"><span style=\" font-family: Arial;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP055","geen technische regels":false}}}]
}
]
}
