"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP330: Indien na dossieroverdracht sprake is van correcties met terugwerkende kracht voor zorg in natura, moet het zorgkantoor dat in de betreffende periode verantwoordelijke was voor de client zorgen voor nieuwe zorgtoewijzingen.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Tot en met de dag voorafgaand aan de overdrachtdatum is het oude zorgkantoor verantwoordelijk voor de client. Met ingang van de overdrachtdatum is het nieuwe zorgkantoor verantwoordelijk voor de client. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Dat houdt in dat het oude zorgkantoor bij correcties met terugwerkende kracht die de periode voor de overgangsdatum betreffen, moet zorgen voor nieuwe zorgtoewijzingen.&nbsp;<p style=\"margin-top: 3pt;\">Indien deze correcties ook van toepassing zijn op de periode vanaf de overdrachtdatum, kan dat vanuit het oude zorgkantoor leiden tot een verzoek aan het nieuwe zorgkantoor om een nieuwe bovenregionale zorgtoewijzing te versturen. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Deze regel geldt uitsluitend voor zorg in natura en niet voor pgb.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"ZK31","id":29659,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP330"}}}]
}
]
