"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Aanbieder die de zorg thuis coordineert. Deze aanbieder is het aanspreekpunt voor de client en voor de andere aanbieders die bij de zorglevering van het modulair pakket thuis (MPT) aan de client betrokken zijn.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"type":{"type":"object","value":{"name":"LDT_iWlzAgbCode","id":28308,"typeIconPath":"data/icons/UML/UML_DataType.png"}}},"Multipliciteitselement":{"onder":"0"}}}]
