"typeIconPath":"data/icons/ArchiMate/MotivationRequirement.png",
"data" : [
{
"lang":"nl",
"name":"OP322: Als met de aanvraag van een aangepaste zorgtoewijzing de leveringsstatus en/of de classificatie van een eerder afgegeven toewijzing wijzigt, moet voor die eerdere toewijzing in hetzelfde bericht een mutatie ZZP worden opgenomen.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Het gaat hier om de situaties waarin &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">* de client de zorg (nu) nog niet wil ontvangen (MUT12) &nbsp;<p style=\"margin-top: 3pt;\">* de aanbieder de zorg nu nog niet kan leveren (MUT18) &nbsp;<p style=\"margin-top: 3pt;\">* de zorglevering is beeindigd (MUT19) &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien bij de aanvraag aangepaste zorgtoewijzing geen sprake is van een wijziging in de leveringsstatus en/of classificatie, is een mutatiezorgzwaartepakket niet van toepassing. De zorgaanbieder neemt uitsluitend een aanvraag aangepaste zorgtoewijzing in het bericht op.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK39","id":30559,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP322"}}}]
}
]
