"29200" : {
"id":29200,
"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV049: Hoe moet de ZzpCode worden gevuld in de CA-berichten?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">De ZzpCode moet in het melding Aanvang Zorg CAK bericht (CA317) bij leveringsvorm Verblijf, DTV, VPT of MPT gevuld worden met het Geleverde ZZP. Bij leveringsvorm PGB en VKB moet de ZzpCode gevuld worden met het Geindiceerde ZZP. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien er geen Geindiceerd ZZP is, maar sprake is van Geindiceerde Functies (Wlz-indiceerbaren die ook ADL ontvangen), wordt ZZP-code 996 gebruikt voor levering van functies in natura en wordt ZZP-code 997 gebruikt indien sprake is van een pgb. &nbsp;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">ZZP-code 998 is bedoeld voor onbekende ZZP's (ZZP-X). &nbsp;&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV049"}}}]
}
]
}
