"data" : [
{
"lang":"nl",
"name":"OP191: Het gebruik van ongestructureerde informatie dient tot een minimum beperkt te worden.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Commentaar mag in het indicatiebesluitbericht gebruikt worden om extra informatie op te nemen mits voldaan wordt aan de voorwaarden die de Algemene Verordening Gegevensbescherming (AVG) hier aan stelt. &nbsp;<p style=\"margin-top: 3pt;\">Het commentaar mag geen tot de client herleidbare gegevens bevatten. Dat wil zeggen dat het commentaar uitsluitend betekenis heeft in combinatie met het bericht waar het onderdeel van uitmaakt.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Daarnaast moet voldaan worden aan de hieronder staande voorwaarden:&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Clientgegevens:&nbsp;<p style=\"margin-top: 3pt;\">Het commentaar moet een toelichting zijn op de client en niet elders in het indicatiebesluit (als commentaar) kunnen worden opgenomen.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indicatiebesluit:&nbsp;<p style=\"margin-top: 3pt;\">Indicatiesteller + telefoonnummer.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Zorgeenheid:&nbsp;<p style=\"margin-top: 3pt;\">Het commentaar moet een toelichting op de geindiceerde zorgeenheid bevatten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Ziektebeeld en stoornis:&nbsp;<p style=\"margin-top: 3pt;\">Het commentaar moet een toelichting op de ziektebiografie bevatten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Score stoornis:&nbsp;<p style=\"margin-top: 3pt;\">Het commentaar moet een toelichting op de score stoornis bevatten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Beperkingen:&nbsp;<p style=\"margin-top: 3pt;\">Het commentaar moet een toelichting op de beperkinggegevens bevatten.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Score beperking:&nbsp;<p style=\"margin-top: 3pt;\">Het commentaar moet een toelichting op de score beperking bevatten.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"IO31","id":29310,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP191","geen technische regels":false}}}]
}
]
