"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">Een zorgtoewijzingbericht wordt niet alleen gestuurd naar de aanbieders voor wie de zorgtoewijzing nieuw of gewijzigd is. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In het geval van een nieuw indicatiebesluit worden voor de te leveren zorg nieuwe zorgtoewijzingen (eventueel doorlopende zorg) aangemaakt. De volgorde waarin deze zorgtoewijzingen worden aangemaakt mag daarbij geen invloed hebben op het informeren van alle bij de zorg betrokken aanbieders.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW33","id":30150,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"ZK33","id":30568,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP087","geen technische regels":false}}}]
