"lang":"nl",
"name":"IV050: Hoe moet de Startdatum worden gevuld in de CA-berichten?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 9pt;\">De Startdatum moet worden gevuld met de datum vanaf wanneer de zorgeenheid wordt geleverd (Begindatum), tenzij de Sleuteldatum aanwezig is. Dan moet de Startdatum gevuld worden met de datum vanaf wanneer het verblijf beschikbaar is voor de client (Sleuteldatum). &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Indien meerdere zorgaanbieders betrokken zijn bij de levering van zorg in natura aan een (1) client, vult het zorgkantoor de Startdatum met de kleinste begindatum (of sleuteldatum), zoals vastgesteld op basis van ontvangen aanvang zorg berichten. &nbsp;<p style=\"margin-top: 3pt;\">"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV050"}}}]
