"lang":"nl",
"name":"OP327: Iedere nieuwe melding 'Geleverde zorg' aan het CAK krijgt een nummer om de aanlevering uniek te identificeren.",
"type":"Requirement",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 8pt;\">De eigen bijdrage wordt vastgesteld op basis van alle aan een client geleverde zorg met dezelfde leveringsvorm. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">Er is sprake van een nieuwe melding &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;wanneer het een aanlevering voor een nieuwe cli&#235;nt betreft;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;wanneer het een aanlevering voor een bestaande cli&#235;nt betreft voor wie zich een nieuwe situatie voordoet waarbij &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* de leveringsvorm wijzigt; &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* in geval van VPT of (deeltijd)verblijf een andere aanbieder de zorg gaat leveren; &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* in geval van deeltijdverblijf het aantal etmalen wijzigt; &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* het zorgprofiel wijzigt;&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;&nbsp;&nbsp;&nbsp;* het zorgkantoor wijzigt.&nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"CA317","id":27946,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP327"}}}]
