"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">* Wacht op voorkeur: de client wil de toegewezen zorgeenheid ontvangen, maar alleen van de betreffende aanbieder/locatie;&nbsp;<p style=\"margin-top: 3pt;\">* Wacht uit voorzorg: de client wil de toegewezen zorgeenheid niet ontvangen;&nbsp;<p style=\"margin-top: 3pt;\">* In zorg: de client ontvangt de toegewezen zorgeenheid;&nbsp;<p style=\"margin-top: 3pt;\">* Einde zorgvraag: de client wil de toegewezen zorgeenheid niet (meer) van de betreffende zorgaanbieder ontvangen;&nbsp;<p style=\"margin-top: 3pt;\">* Urgent plaatsen: de client wil de toegewezen zorgeenheid zo spoedig mogelijk ontvangen;&nbsp;<p style=\"margin-top: 3pt;\">* Actief plaatsen: de client wil de toegewezen zorgeenheid ontvangen.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW39","id":27986,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}},{"type":"object","value":{"name":"AW35","id":30565,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Bedrijfsregel":{"code":"OP098","geen technische regels":false}}}]
