"typeIconPath":"data/icons/ArchiMate/MotivationUseCase.png",
"data" : [
{
"lang":"nl",
"name":"IV016: Hoe moet de datum geldigheid (einde) indicatiebesluit worden gevuld in het wachtlijstbericht?",
"type":"Usecase",
"categories":[{"type":"documentation","title":"documentatie","content":{"type":"rtf","value":"<span style=\" font-size: 10pt;\">In het wachtlijstbericht geeft de Einddatum het daadwerkelijke einde aan van de geldigheid van de indicatie. Ten opzichte van de door het CIZ afgegeven einddatum kan deze datum dus moeten worden aangepast indien er sprake is van een herindicatie of indien er sprake is van het overlijden van de client. &nbsp;<p style=\"margin-top: 3pt;\">&nbsp;<p style=\"margin-top: 3pt;\">In het geval er sprake is van een herindicatie wordt de datum geldigheid (einde) indicatiebesluit gevuld met de datum die een (1) dag ligt voor de ingangsdatum van de herindicatie. &nbsp;<p style=\"margin-top: 3pt;\">In het geval er sprake is van het overlijden van de client wordt de datum geldigheid (einde) indicatiebesluit gevuld met de datum van overlijden.&nbsp;<p style=\"margin-top: 3pt;\"></span>"}},{"type":"table","title":"__is_translate_properties_title__","content":{"":{"wordt gebruikt in":{"type":"collection","value":[{"type":"object","value":{"name":"AW317","id":30562,"typeIconPath":"data/icons/UML/UML_ClassDiagram.png"}}]}},"Invulinstructie":{"code":"IV016"}}}]
}
]
